import React from "react";
import styled from "styled-components";

const Box = styled.div`
  display: flex;
  width: 500px;
  height: 359px;
  border-radius: 50px;
  background: #f6d7d2;
  box-sizing: border-box;
`;

const Text = styled.div`
  color: #000;
  font-family: Roboto;
  font-size: 48px;
  font-style: normal;
  font-weight: 700;
  padding: 50px;
  box-sizing: border-box;
`;

export default function AboutMe() {
  return (
    <Box>
      <Text>About Me</Text>
    </Box>
  );
}
